1. Benih
Benih harus jelas dari mana asalnya, apakah dari kolam terpal,plastik,semen atau kolam tanah. Benih ikan yang berasal dari kolam tanah sebaiknya tidak dibudidayakan/dibersarkan dikolam semen,terpal atau plastik. Hal demikian memaksa benih masuk ke kondisi yang berbeda sehingga mengakibatkan benih mengalami hambatan pertumbuhan yang pada akhirnya terkena penyakit.

2. Jumlah padat tebar 
Sebagian besar para pelaku usaha/petani tidak menghitung berapa jumlah tebaran benih yang sesuai dengan ukuran kolam mereka karena berbagai alasan, mulai dari untuk mencari keuntungan yang maksimal dan hanya sebagai kegiatan sampingan. Padat tebar untuk budidaya gurami maksimal 15ekor/meter.

3. Pakan buatan pabrik (pelet)
Banyak anggapan bahwa pakan buatan pabrik (pelet) dengan kadar protein diatas 30% tidak baik untuk gurami karena menyebabkan ikan jadi cepat sakit terutama mata bengkak, hal itu disebabkan karena semakin tinggi kadar protein maka semakin tinggi juga kadar amoniak. Akan tetapi jika diberi pakan pelet dengan kadar protein dibawah 30% pertumbuhan semakin lambat, menambah biaya operasional produksi dan lebih rentan terkena penyakit.

4. Pakan hijauan (daun)
Gurami tergolong jenis ikan omnivora bahkan cenderung ke herbivora. Pemberian pakan hijauan sifatnya hanya sebagai tambahan, bukan utama. Sedangkan untuk memacu pertumbuhan ikan gurami tetap harus menggunakan pakan pelet degan kadar protein diatas 30%. 

5. Desain kolam
Desain kolam yg efektif menentukan keberhasilan panen, untuk Ikan gurami konsumsi kedalaman kolam minimal 1meter yang terdapat saluran untuk air masuk serta pembuangan air. Selain itu kolam harus terkena sinar matahari langsung, semakin banyak dan lama terkena sinar matahari maka semakin bagus.

